import React, { useEffect, useRef } from 'react';
import { init } from "ityped";
import '../styles/Home.css';
import { motion } from 'framer-motion';
import { Container, Typography, Link, Grid, Box } from '@mui/material';
import BlueMoon from "../assets/BlueMoon.png";




function Home() {
    const textRef = useRef();
    const classes = useStyles();

  // useEffect(() => {
  //   init(textRef.current, {
  //     loop: true,
  //     showCursor: true,
  //     backSpeed: 100,
  //     startDelay: 120,
  //     backDelay: 1700,
  //     strings: ["Student", "Developer", "Wonderer"],
  //   });
  // }, []);

  const path = "M0,100 Q50,50 100,100 Q150,150 200,100";

  return (
      <Container className="header" sx={{ flexGrow: 6 }}>
        <Grid container >
          <Grid item>
            <Container className="moon">
              <motion.img
                className="moon"
                src={BlueMoon}
                alt="moon"
                animate={{ path: path }}
                transition={{ duration: 20, repeat: Infinity }}
              />
            </Container>
          </Grid>

          <Grid item>
            <Box className="container">
              <motion.div className="text">
                I love crafting <br/> captivating experiences for the digital world to savor.
              </motion.div>
            </Box>
          </Grid>

        </Grid>
      </Container>
  );
}

export default Home;
